import React from 'react';

function Messages({ messages }) {
  messages.map((item) => {
    return (
      <div className="row messages-row" key={item.id}>
        <div className="col-12 col-sm-12 col-md-6 col-lg-6 col-xl-6">
          <div className="row">
            <h1>{item.title}</h1>
          </div>
          <div className="row">
            <p>{item.body}</p>
          </div>
        </div>
      </div>
    );
  });
}

export default Messages;
